import React from "react";
import _ from "lodash";
import { Grid, Button, Typography, Hidden } from "@material-ui/core";
import { 
  qualityTitle,
  extraQualityTitle,
  toturialTitle,
  toturialContent,
  toolTitle,
  toolContent,
  warrantTitle,
  warrantContent,
  integratedTitle,
  integratedContent,
  integratedContentone,
  integratedContentTwo,
  postEasyTitle,
  postEasyContent,
  controlTitle,
  controlContent,
  priceListTitle,
  priceListContent,

  qualitys,
} from "./Constants"
const Icon01 = require('../../assets/images/post-icon-01.svg');
const Icon02 = require('../../assets/images/post-icon-02.svg');
const Icon03 = require('../../assets/images/post-icon-03.svg');
const Icon04 = require('../../assets/images/post-icon-04.svg');
const Icon05 = require('../../assets/images/post-icon-05.svg');

const Benefit = () => {
  return (
    <div className={"mission-area body-general"} style={{ textAlign: 'center' }} >
      <Typography variant="h4" style={{ fontWeight: 700 }} >
        {qualityTitle}
      </Typography>
      <Typography style={{ fontWeight: 500 }} >
        {extraQualityTitle}
      </Typography>
      {/* <XX /> */}
      {qualitys.map((element: any, index: number) => {
        return (
          <Grid container spacing={10}>
            <Grid item xs={4}>
              <img src={element.icon} style={{ width: "50", height: "60", padding: "12px" }} />

            </Grid>

          </Grid>
        )
      })}
     
    </div>    
  );
};

export default Benefit;
